class TranslateService {
	public get(key?: any, params?: any): any {
		return key;
	}
	public instant(key?: any, params?: any): any {
		return key;
	}
}

class Fake extends TranslateService {

}

class SampleComponent {

	protected _fakeTranslateService: any;

	public propertyValue = 'hej';

	constructor(
		protected _translateService: TranslateService,
		public ignoreMe: Object,
		_doNotExtractMe: TranslateService
	) {
		_translateService.get('OK');
	}

	public get(key?: string, params?: any) {

	}

	init() {
		this._translateService.instant('Email: { email }', { email: this.propertyValue });

		this._translateService.get('You are expected at {{time}}', {time: moment.format('H:mm')}).subscribe();
	}

}
